import React, {
  Component
} from 'react'
import {
  Form,
  Input,
  Select,
  Upload,
  Icon,
  Modal,
  Switch,
  Radio,
  Rate
} from 'antd';
import './Add.less';
const FormItem = Form.Item;


export default class Temp extends Component {
  render() {
    const {
      getFieldProps,
      getFieldError,
      isFieldValidating,
      getFieldDecorator
    } = this.props.props.form;
    const formItemLayout = { //样式
      labelCol: {
        span: 7
      },
      wrapperCol: {
        span: 12
      },
    };
    const storeData = this.props.state.storeData;

    return ( <
      Form >
      <
      FormItem {
        ...formItemLayout
      }
      label = "菜品销售量："
      style = {
        {
          lineHeight: "55px"
        }
      } >
      {
        getFieldDecorator('saleVolume', {
          initialValue: storeData.saleVolume,
        })( <
          Rate / >
        )
      } <
      /FormItem> <
      FormItem {
        ...formItemLayout
      }
      label = "菜品销售量：" >
